$.formattedDate = function (dateToFormat) {
    var dateObject = new Date(dateToFormat);
    var day = dateObject.getDate();
    var month = dateObject.getMonth() + 1;
    var year = dateObject.getFullYear();
    var hour = dateObject.getHours();
    var minutes = dateObject.getMinutes();
    var seconds = dateObject.getSeconds();
    day = day < 10 ? "0" + day : day;
    month = month < 10 ? "0" + month : month;
    hour = hour < 10 ? "0" + hour : hour;
    minutes = minutes < 10 ? "0" + minutes : minutes;
    seconds = seconds < 10 ? "0" + seconds : seconds;

    var formattedDate = day + "-" + month + "-" + year + " " + hour + ":" + minutes + ":" + seconds;
    return formattedDate;
};


function buscarServicios() {

    $.blockUI({
        message: '<h2>Espere por favor</h2>',
    });

    const fInicial = $("#fInicialS").val();
    const fFinal = $("#fFinalS").val();
    const idEstacion = $("#idEstacion").val();
    const tipo = $("#idTipo").val();
    const modulo = $("#idModulo").val() == undefined ? -1 : $("#idModulo").val();


    const data = {
        fInicial, fFinal, idEstacion, modulo, tipo
    };

    $.ajax({
        url: "Servicios.aspx/serviciosXFecha",
        type: "POST",
        contentType: "application/json;charset=utf-8",
        data: JSON.stringify(data),
        dataType: "json",
        success: function (result) {

            tabla_lista.clear().draw();

            if (result.d.Data == null) {
                $.gritter.add({
                    title: "Fallo",
                    text: "No se encontraron Servicios con los filtros ingresados",
                    sticky: false
                });
                setTimeout($.unblockUI, 500);
                return;
            }

            if (result.d.Result) {

                $('#tabla_resumen_wrapper').hide();
                $('#tabla_lista_wrapper').show();
                $('#tabla_unidad_wrapper').hide();
                $('#divserviciosUnidad').hide();
                $('#tabla_empresa_wrapper').hide();
                $('#Tablas').show();


                var parsedTest = JSON.parse(result.d.Data);
                for (var i = 0; i < parsedTest.length; i++) {

                    tabla_lista.row.add([
                        parsedTest[i]['tVenta'],
                        parsedTest[i]['unidad'],
                        parsedTest[i]['nEco'],
                        parsedTest[i]['empresa'],
                        parsedTest[i]['despachador'],
                        $.formattedDate(new Date(parseInt(parsedTest[i]['fechaVenta'].substr(6)))),
                        parsedTest[i]['fCortesia'],
                        parsedTest[i]['cCortesia'],
                        parsedTest[i]['kilometraje'],
                        parsedTest[i]['mPago'],
                        parsedTest[i]['estacion'],
                        parsedTest[i]['medidor'],
                        parsedTest[i]['nServicio'],
                        parsedTest[i]['litros'],
                        parsedTest[i]['pGas'],
                        parsedTest[i]['total'],
                    ]).draw();

                }
                setTimeout($.unblockUI, 500);
                fInicialT = $("#fInicialS").val();
                fFinalT = $("#fFinalS").val();
            }
        },
        error: function (errormessage) {
            console.log(errormessage);
        }
    });

}

