function bServiciosResumen() {

    $.blockUI({
        message: '<h2>Espere por favor</h2>',
    });

    const fInicial = $("#fInicialR").val();
    const fFinal = $("#fFinalR").val();
    const zonas = $("#zonaV").val();
    const estatus = $("#estatus").val();
    const consumos = $("#consumos").val();
    const tipo = $("#tipoV").val();

    if (estatus == null || fInicial == "" || fFinal == "") {
        $.gritter.add({
            title: "Éxito",
            text: "La Fecha Inicial, Fecha Final y Estatus son datos requeridos",
            sticky: false
        });
        setTimeout($.unblockUI, 500);
        return;
    }

    const data = {
        fInicial, fFinal, zonas, estatus, consumos, tipo
    };

    $.ajax({
        url: "Servicios.aspx/serviciosResumen",
        type: "POST",
        contentType: "application/json;charset=utf-8",
        data: JSON.stringify(data),
        dataType: "json",
        success: function (result) {

            tabla_resumen.clear().draw();

            if (result.d.Data == null || result.d.Data == "[]") {
                $.gritter.add({
                    title: "Fallo",
                    text: "No se encontraron Servicios con los filtros ingresados",
                    sticky: false
                });
                setTimeout($.unblockUI, 500);
                return;
            }

            if (result.d.Result) {

                $('#Tablas').show();

                $('#tabla_lista_wrapper').hide();
                $('#tabla_resumen_wrapper').show();
                $('#tabla_unidad_wrapper').hide();
                $('#divserviciosUnidad').hide();
                $('#tabla_empresa_wrapper').hide();

                var parsedTest = JSON.parse(result.d.Data);

                for (var i = 0; i < parsedTest.length; i++) {


                    let estatus = parsedTest[i]['estatus_instalacion'];

                    switch (estatus) {
                        case 1:
                            estatus = "Activo"
                            break;

                        case 2:
                            estatus = "Desinstalado"
                            break;

                        case 3:
                            estatus = "Vendido"
                            break;

                        case 4:
                            estatus = "Robado"
                            break;

                        case 5:
                            estatus = "Cambio de propietario"
                            break;

                        case 6:
                            estatus = "Proceso Jurídico"
                            break;

                        case 7:
                            estatus = "Otro"
                            break;
                    }

                    var vol = parsedTest[i]['volumen'] == null ? 0 : parsedTest[i]['volumen'];

                    let promedio = parsedTest[i]['promedio'] == null ? 0 : parsedTest[i]['promedio'];

                    let fechaUltimo = parsedTest[i]['ultima_carga'] == null ? 'Sin fecha' : $.formattedDate(new Date(parseInt(parsedTest[i]['ultima_carga'].substr(6))));


                    tabla_resumen.row.add([
                        parsedTest[i]['un_codigo_barra'],
                        parsedTest[i]['un_numero_economico'],
                        parsedTest[i]['emp_nombre'],
                        parsedTest[i]['co_nombre'],
                        parsedTest[i]['un_direccion'],
                        parsedTest[i]['un_telefono'],
                        $.formattedDate(new Date(parseInt(parsedTest[i]['un_fecha_instalacion'].substr(6)))),
                        estatus,
                        parsedTest[i]['servicios'],
                        vol,
                        parsedTest[i]['dias'],
                        promedio,
                        fechaUltimo,
                    ]).draw();

                }
                setTimeout($.unblockUI, 500);
                fInicialT = $("#fInicialR").val();
                fFinalT = $("#fFinalR").val();
            }
        },
        error: function (errormessage) {
            console.log(errormessage);
        }
    });

}

function cEstaciones() {

    $.ajax({
        url: "Estaciones.aspx/cEstaciones",
        type: "POST",
        contentType: "application/json;charset=utf-8",
        dataType: "json",
        success: function (result) {
            if (result.d.Result) {
                var parsedTest = JSON.parse(result.d.Data);
                $('#idEstacion').append("<option value='-1' selected>Todas</option>");
                $('#idEstacionU').append("<option value='-1' selected>Todas</option>");
                $('#idEstacionE').append("<option value='-1' selected>Todas</option>");
                for (var i = 0; i < parsedTest.length; i++) {
                    $('#idEstacion').append("<option value='" + parsedTest[i].id + "'>" + parsedTest[i].nombre + "</option>");
                    console.log(parsedTest[i].id + " " + parsedTest[i].nombre);
                    $('#idEstacionU').append("<option value='" + parsedTest[i].id + "'>" + parsedTest[i].nombre + "</option>");
                    $('#idEstacionE').append("<option value='" + parsedTest[i].id + "'>" + parsedTest[i].nombre + "</option>");
                }
            }

        },
        error: function (errormessage) {
            console.log(errormessage);
        }
    });
}

