// Traer comodatarios para el filtro
function GetComodatario() {

    const data = JSON.stringify({
        nombre: '',
        telefono: ''
    });

    $("#idComodatarioE").html('<option value="-1" selected>Todos</option>');
    $.ajax({
        url: "Comodatarios.aspx/traer_comodatarios",
        type: "POST",
        contentType: "application/json;charset=utf-8",
        data: data,
        dataType: "json",
        success: function (result) {
            if (result.d.Result) {
                var parsedTest = JSON.parse(result.d.Data);
                for (var i = 0; i < parsedTest.length; i++) {
                    if (parsedTest[i]['activo'] == 1) {
                        $("#idComodatarioE").append('<option value="' + parsedTest[i]['id'] + '">' + parsedTest[i]['nombre'] + '</option>');
                    }
                }

            }
            $("#idComodatarioE").select2();

        },
        error: function (errormessage) {
            console.log(errormessage);
        }
    });
}

