function buscarServiciosU() {
    $.blockUI({
        message: '<h2>Espere por favor</h2>',
    });

    const fInicial = $("#fInicialUni").val();
    const fFinal = $("#fFinalUni").val();
    const idUnidadU = $('#idUnidadU').val();
    const idEstacionU = $("#idEstacionU").val();
    const idModuloU = $("#idModuloU").val();

    if (idUnidadU == null || fInicial == "" || fFinal == "") {
        $.gritter.add({
            title: "Éxito",
            text: "La Fecha Inicial, Fecha Final y la Unidad son datos requeridos",
            sticky: false
        });
        setTimeout($.unblockUI, 500);
        return;
    }

    const data = {
        fInicial, fFinal, idUnidadU, idEstacionU, idModuloU
    };

    $.ajax({
        url: "Servicios.aspx/serviciosUnidad",
        type: "POST",
        contentType: "application/json;charset=utf-8",
        data: JSON.stringify(data),
        dataType: "json",
        success: function (result) {

            tabla_unidades.clear().draw();

            if (result.d.Data == null || result.d.Data == "[]") {
                $.gritter.add({
                    title: "Fallo",
                    text: "No se encontraron Servicios con los filtros ingresados",
                    sticky: false
                });
                setTimeout($.unblockUI, 500);
                return;
            }

            if (result.d.Result) {

                $('#Tablas').show();

                $('#tabla_lista_wrapper').hide();
                $('#tabla_resumen_wrapper').hide();
                $('#tabla_unidad_wrapper').show();
                $('#divserviciosUnidad').show();
                $('#tabla_empresa_wrapper').hide();

                var parsedTest = JSON.parse(result.d.Data);


                $('#contratoL').text(parsedTest[0]['un_codigo_barra']);
                $('#nEconomicoL').text(parsedTest[0]['un_numero_economico']);
                $('#comodatarioL').text(parsedTest[0]['co_nombre']);
                $('#placaL').text(parsedTest[0]['un_placa']);
                $('#marcaL').text(parsedTest[0]['ma_descripcion']);
                $('#modeloL').text(parsedTest[0]['mod_descripcion']);
                $('#anioL').text(parsedTest[0]['anio']);
                $('#empresaL').text(parsedTest[0]['emp_nombre']);
                // $('#').val(parsedTest[i]['un_codigo_barra']);

                for (var i = 0; i < parsedTest.length; i++) {

                    var kmRecorridos = parsedTest[i]['ve_kilometros'] - parsedTest[i]['ve_kilometros_ant'];

                    let litrosAnt = parsedTest[i]['litrosAnterior'];
                    let rendimiento;
                    if (litrosAnt > 0) {
                        rendimiento = kmRecorridos / parsedTest[i]['litrosAnterior'];
                    }
                    else {
                        rendimiento = 0;
                    }

                    // litrosAnterior
                    tabla_unidades.row.add([
                        parsedTest[i]['un_codigo_barra'],
                        parsedTest[i]['Despachador'],
                        parsedTest[i]['medidor'],
                        parsedTest[i]['esta_descripcion'],
                        $.formattedDate(new Date(parseInt(parsedTest[i]['ve_fecha_venta'].substr(6)))),
                        parsedTest[i]['ve_servicio'],
                        parsedTest[i]['ve_precio_gas'],
                        parsedTest[i]['ve_litros'],
                        parsedTest[i]['ve_total'],
                        parsedTest[i]['ve_kilometros_ant'],
                        parsedTest[i]['ve_kilometros'],
                        kmRecorridos,
                        rendimiento,
                    ]).draw();

                }
                setTimeout($.unblockUI, 500);
                fInicialT = $("#fInicialR").val();
                fFinalT = $("#fFinalR").val();
            }
        },
        error: function (errormessage) {
            console.log(errormessage);
        }
    });
}

